import React from "react";

import { Paper, Chip } from "@mui/material";
import AccountBoxIcon from "@mui/icons-material/AccountBox";

const ViewEmployee = () => {
  return (
    <Paper elevation={3}>
      <Chip
        label="View Profile"
        color="primary"
        variant="outlined"
        icon={<AccountBoxIcon />}
      />
    </Paper>
  );
};

export default ViewEmployee;
